        <div class="" col-md-8 text-body"">
            <h1>Our Story</h1>
            <p class=""p-s"">
                <b>Who We Are</b>
                <br />
                There’s nothing cookie-cutter about Pizza Hut. Not our pizzas. Not our people. And definitely not the way we live life. Around here, we don’t settle for anything less than food we’re proud to serve.
                And we don’t just clock in. Not when we can also become our best, make friends, and have fun while we’re at it.&nbsp;
                <strong>We’re the pizza company that lives life unboxed.</strong>
            </p>
            <p class=""p-s"">
                We’re not for people who want to blend in: pushing boundaries is part of our heritage. We have more than 16,000 restaurants and 350,000 team members in more than 100 countries.
                Whether it’s the original Stuffed Crust or putting a pizza in outer space, we never stop driving ourselves to deliver hot pizzas, fast every time – anyw");
            WriteLiteral(@"here you want to enjoy it.
            </p>
            <p class=""p-s"">
                <b>What We Are About</b>
                <br />
                At Pizza Hut, we don’t just make pizza. We make people happy. Pizza Hut was built on the belief that pizza night should be special, and we carry that belief into everything we do. With more than 60 years of experience under our belts,
                we understand how to best serve our customers through tried and true service principles:&nbsp;
                <strong>We create food we’re proud to serve and deliver it fast, with a smile.</strong>
            </p>
            <p class=""p-s"">
                <b>Where We Come From</b>
                <br />
                In 1958, two brothers borrowed $600 from their mom to open a pizza place in Wichita, Kansas. They named it Pizza Hut, because their sign only had room for eight letters. How profound!
            </p>
            <p class=""p-s"">Soon, the restaurant grew. Why? The pizza was awesome.");
            WriteLiteral(@" The service felt like home. And the customers were treated like family.</p>
            <p class=""p-s"">And we’ve been delivering that same food and service ever since.</p>
            <p class=""p-s"">
                <b>For The Love Of Pizza Since 1958</b>
                <br />
                From day one, the Carney brothers could look their customers in the eye and promise them the finest pizza in town — because they knew the farmers who grew the ingredients, and they knew those farmers cared about quality.
            </p>
            <p class=""p-s"">
                Since then, our farmers have grown right alongside us, and the ingredients we use are still our highest priority. No one loves pizza more than Pizza Hut. That’s why pizza is in our name — and always will be.
            </p>
